import React from 'react';

export default function UpcomingEvents() {
  return (
    <section id="upcoming" className="section">
      <h2>Upcoming Events</h2>
      <p>
        Our next big gathering is just around the corner. Check out full details
        at{' '}
        <a
          href="https://digitalfutureweek.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          digitalfutureweek.com
        </a>.
      </p>
    </section>
  );
}
